
<!DOCTYPE html>
<head>
<meta http-equiv="Content-Type" content="text/html; charset=utf-8">
<title>Saiku Embedded - Next Generation Open Source Analytics in
	your App!</title>
<link rel="shortcut icon" href="favicon.ico">

<style>
body {
	background: none repeat scroll 0 0 #FFFFFF;
	color: #222222;
	font-family: "Helvetica Neue", Arial, Helvetica, sans-serif;
	font-size: 68.75%;
}
</style>

</head>
<body>
<header class="header" data-ng-include="'app/views/header.html'"></header>



	<div class="dropdown" data-ng-show='showDropdownadmin'>
		<button class="btn btn-default dropdown-toggle" type="button"
			data-toggle="dropdown">
			Reports <span class="caret"></span>
		</button>
		<ul class="dropdown-menu">
			<li data-ng-repeat="x in finalAdminList"><a
				data-ng-click="selectedAdmin($index)"> {{x}} </a></li>
		</ul>

	</div><br>
	<br>
	<br><div>
	</div>
	<br>
	<br>
	
		<div class="dropdown" data-ng-show='showDropdown'>
		<button class="btn btn-default dropdown-toggle" type="button"
			data-toggle="dropdown">
			Reports <span class="caret"></span>
		</button>
		<ul class="dropdown-menu">
			<li data-ng-repeat="x in finalSupervisorList"><a
				data-ng-click="selectedUser($index)"> {{x}} </a></li>
		</ul>

	</div><br>
	<br>
	<br><div>
	</div>
	<br>
	<br>
	
	<!--  jQuery 1.7.2 , jQuery UI 1.8.14-->
	<script src="../js/jquery/jquery.min.js" type="text/javascript"></script>
	<script src="../js/jquery/jquery-ui.min.js" type="text/javascript"></script>

	<!-- BACKBONE -->
	<script type="text/javascript" src="../js/backbone/underscore.js"></script>
	<script type="text/javascript" src="../js/backbone/json2.js"></script>
	<script type="text/javascript" src="../js/backbone/backbone.js"></script>

	<!-- CCC2 -->
	<script type="text/javascript"
		src="../js/saiku/plugins/CCC_Chart/def.js"></script>
	<script type="text/javascript"
		src="../js/saiku/plugins/CCC_Chart/protovis.js"></script>
	<script type="text/javascript"
		src="../js/saiku/plugins/CCC_Chart/protovis-msie.js"></script>
	<script type="text/javascript"
		src="../js/saiku/plugins/CCC_Chart/cdo.js"></script>
	<script type="text/javascript"
		src="../js/saiku/plugins/CCC_Chart/pvc.js"></script>
	<script type="text/javascript"
		src="../js/saiku/plugins/CCC_Chart/jquery.tipsy.js"></script>
	<script type="text/javascript"
		src="../js/saiku/plugins/CCC_Chart/tipsy.js"></script>
	<link type="text/css" href="../js/saiku/plugins/CCC_Chart/tipsy.css"
		rel="stylesheet" />

	<!-- SAIKU EMBEDDED LIBRARIES -->
	<!-- <link rel="stylesheet" href="../css/saiku/src/saiku.table.css" type="text/css"> -->
	<link rel="stylesheet" href="embed/saiku.css" type="text/css">
	<script type="text/javascript"
		src="../js/saiku/render/SaikuRenderer.js"></script>
	<script type="text/javascript"
		src="../js/saiku/render/SaikuTableRenderer.js"></script>
	<script type="text/javascript"
		src="../js/saiku/render/SaikuChartRenderer.js"></script>
	<script type="text/javascript" src="../js/saiku/embed/SaikuEmbed.js"></script>

	<div id='saiku0' class='workspace_results'
		style='margin-top: 25px; width: 100%'></div>
	<div id='saiku1' class='workspace_results'
		style='margin-top: 25px; width: 100%'></div>
	<div id='saiku2' class='workspace_results'
		style='margin-top: 25px; width: 100%'></div>

	<div id='saiku3' class='workspace_results'
		style='margin-top: 25px; width: 100%'></div>
	<div id='saiku4' class='workspace_results'
		style='margin-top: 25px; width: 100%'></div>

	
</body>
<br>
<footer class="footer wow" data-wow-duration="2s"
	data-ng-include="'app/views/footer.html'"></footer>
</html>
